import React from "react";
import { myCss } from "../../myCss";

//Material-ui stuff
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";
import Taypography from "@material-ui/core/Typography";
import withStyles from "@material-ui/core/styles/withStyles";

const styles = myCss;

const TopOfPage = (props) => {
  const { classes } = props;
  return (
    <Grid container spacing={1}>
      <Grid  className={classes.gridItem} item xs={6}>
        <Paper className={classes.paper}>Hello</Paper>
      </Grid>
      <Grid className={classes.gridItem} item xs={6}>
        <Paper >Cum la voi</Paper>
      </Grid>
    </Grid>
  );
};

export default withStyles(styles)(TopOfPage);
